import React from 'react';

import './Styles.scss';

const Navbar = () => {
  return (
    <div id="navbarContainer">
      <div id="navbarContent">
        <img alt="logo" src="assets/logo.png" />
      </div>
    </div>
  )
}

export default Navbar;
